description:
Stranger with My Face (2009)

After the shocking and untimely death of her husband, Shelley Stratton (Catherine Hicks) moves her daughter Alexis (Emily Hirst) and her adopted daughter Laurie (Alexz Johnson), to their remote summer house in hopes of giving her family a fresh start. The family's delicate state begins to unravel when Laurie unearths the dark past, discovering a twin sister she never knew she had.   


